layers.vertexShader:
#version 300 es
precision mediump float;
in vec2 aPos;
uniform float uTime;

void main(){
    vec2 pos = aPos;
    // Deform vertices in a wave pattern
    pos.y += sin(pos.x * 1.0 + uTime) * 0.02;
    pos.x += cos(pos.y * 1.0 + uTime) * 0.02;
    gl_Position = vec4(pos, 0.0, 1.0);
}

layers.fragmentShader:
#version 300 es
precision mediump float;
uniform vec4 uColor;
out vec4 outColor;

void main(){
    // Wave pattern
    float wave = sin(gl_FragCoord.x * 0.05) * 0.5 + 0.5;
    float brightness = mix(0.8, 1.0, wave);
    outColor = vec4(uColor.rgb * brightness, uColor.a);
}
